import React, { useEffect, useState } from 'react'
import Default_layout from '../Components/defalt_layout'
import axios from "axios"
import Item from '../Components/Item'
import { Col, Row } from 'antd'
import { useDispatch } from 'react-redux'
function HomePage() {
  const [items, setItems] = useState([])
  const [category, setCategory] = useState('Men')
  const categories = [{
    name: "Men",
    image: "data:image/jpeg;base64,"
  },
  {
    name: 'Women',
    image: "data:image/jpeg;base64,",

  },
  {
    name: "Shoes",
    image: "https://c.files.bbci.co.uk/44CF/production/_117751671_satan-shoes1.jpg"
  }
  ]
  const dispatch = useDispatch();

  const getAllItems = () => {
    dispatch({ type: "showLoading" })
    axios.get("/api/items/all-items").then((res) => {
      setItems(res.data)
    }).catch((error) => {
      dispatch({ type: "hideLoading" })
      console.log(error)
    })
  }

  useEffect(() => {
    getAllItems()
  }, [])
  return (
    <Default_layout>
 <div className='d-flex categories'>
   {categories.map((cate)=>{
     return  <div
      onClick={()=>setCategory(cate.name)}
     className={`d-flex category  ${category === cate.name && `selected-category`}`}>
   <h4>{cate.name}</h4>
   <img src={cate.image} height="50" width='80' alt="" />
     </div>
   })}

 </div>

      <Row gutter={20}>
        {items.filter((i)=>i.category===category).map((item) => {
          return <Col xs={22} lg={8} md={8} sm={4}>
            <Item item={item} />
          </Col>
        })}

      </Row>
    </Default_layout>
  )
}

export default HomePage